import React, { useState, useEffect } from 'react';
import './Header.css';
import logoIcon from '../../assets/logo-icon.png';

const Header: React.FC = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <header className={`header ${isScrolled ? 'header-scrolled' : ''}`}>
      <div className="container">
        <div className="header-content">
          <div className="logo">
            <img src={logoIcon} alt="Xposure Collective Logo" className="logo-icon-img" />
            <div className="logo-text">
              <span className="logo-text-main">XPOSURE</span>
              <span className="logo-text-sub">COLLECTIVE</span>
            </div>
          </div>
          
          <nav className="nav">
            <ul className="nav-list">
              <li><a href="#home" className="nav-link">Home</a></li>
              <li><a href="#solutions" className="nav-link">Solutions</a></li>
              <li><a href="#process" className="nav-link">Process</a></li>
              <li><a href="#about" className="nav-link">About</a></li>
              <li><a href="#contact" className="nav-link">Contact</a></li>
            </ul>
          </nav>

          <div className="header-cta">
            <button className="btn btn-primary">Get Started</button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
